function Home() {

    const { user } = useContext(UserContext);
    return(
        <div className="container-fluid">

        <Template
            bgcolor="info"
            header="WELCOME TO BAD BANK"
            showImage={true}



        />    
        <Card
            bgcolor="info"
            header="Bad Bank"
            title="Welcome to the bank"
            text="You can us this bank"
            showImage={true}
            body={(
                <>
                    <h1>Home</h1>
                    <p>{JSON.stringify(user)}</p>
                </>
                )}
        />
        </div>
    );
}


export { Home };
